import React, { useEffect, useState } from 'react';
import { fetchUsers, fetchProducts } from '../services/api';

const AdminDashboard: React.FC = () => {
    const [users, setUsers] = useState([]);
    const [products, setProducts] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            // Example: fetch all users (you may need a dedicated API endpoint for all users)
            // For now, let's fetch a single user as a placeholder
            const userData = await fetchUsers(1); // Replace 1 with actual user ID or loop for all users
            setUsers([userData]);
            const productsData = await fetchProducts();
            setProducts(productsData);
        };
        fetchData();
    }, []);

    return (
        <div className="container">
            <h1>Admin Dashboard</h1>
            <h2>Users</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Username</th>
                        <th>Role</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.username}</td>
                            <td>{user.role}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <h2>Products</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Stock</th>
                    </tr>
                </thead>
                <tbody>
                    {products.map(product => (
                        <tr key={product.id}>
                            <td>{product.id}</td>
                            <td>{product.name}</td>
                            <td>{product.stock}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AdminDashboard;
